    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: 'Jak wynika z opisu, ta badanie wymaga okna w trybie incognito / prywatnym, a to okno nim nie jest. Możesz to naprawić. Korzystając z dowolnej przeglądarki innego niż Safari, otwórz okno w trybie incognito i uruchom w nim link do badania.\n\nWYJAŚNIENIE: Wszystkie główne przeglądarki pozwalają otworzyć okno w trybie incognito, choć nazwa może się różnić, np. "Incognito", "InPrivate", "Private Browsing" lub "Private Window". Wszystkie przeglądarki oprócz Safari informują, czy strona internetowa jest w trybie incognito. Safari zawsze mówi nie. Tryb incognito jest zwykle używany w celu zachowania prywatności. EasyEyes używa go do ułatwienia dostępu do biblioteki Firebase EasyEyes, która jest potrzebna do kalibracji dźwięku.',
    pt: "Loading...",
    ro: "Loading...",
    ru: 'Как указано в его описании, для этого исследования требуется режим инкогнито/приватного окна, а это окно им не является. Вы можете исправить это. Используя любой браузер, кроме Safari, откройте окно в режиме инкогнито и запустите ссылку на исследование в этом окне.\n\nПОЯСНЕНИЕ: Все основные браузеры позволяют открыть окно в режиме инкогнито, хотя название может отличаться, например, "Инкогнито", "InPrivate", "Приватный режим" или "Приватное окно". Все браузеры, кроме Safari, сообщают, находится ли веб-страница в режиме инкогнито. Safari всегда говорит "нет". Режим инкогнито обычно используется для обеспечения конфиденциальности. EasyEyes использует его для облегчения доступа к библиотеке Firebase EasyEyes, которая необходима для калибровки звука.',
    sr: "Loading...",
    es: "Loading...",
    su: "Loading...",
    sw: "Loading...",
    sv: 'Som det står i beskrivningen behöver denna studie ett inkognitofönster, och detta fönster är det inte. Du kan fixa detta. Använd vilken webbläsare som helst förutom Safari, öppna ett inkognitofönster och kör studielänken i det fönstret.\n\nFÖRKLARING: Alla stora webbläsare tillåter dig att öppna ett fönster i inkognitoläge, även om namnet varierar, t.ex. "Incognito", "InPrivate", "Private Browsing" eller "Private Window". Alla webbläsare utom Safari rapporterar om webbsidan är i inkognitoläge. Safari säger alltid nej. Inkognitoläge används vanligtvis för integritetsskydd. EasyEyes använder det för att underlätta åtkomst till EasyEyes Firebase-biblioteket, som behövs för ljudkalibrering.',
    tl: "Loading...",
    tr: '"Bu çalışmanın açıklamasında belirtildiği gibi, bu çalışma gizli/belirli bir pencereye ihtiyaç duyuyor, ancak bu pencere öyle değil. Bunun düzeltilmesi mümkün. Safari dışındaki herhangi bir tarayıcıyı kullanarak, gizli bir pencere açın ve çalışma bağlantısını bu pencerede çalıştırın.\n\nAÇIKLAMA: Tüm büyük tarayıcılar, adı farklı olsa da, gizli modda bir pencere açmanıza izin verir, örneğin "Gizli", "InPrivate", "Özel Gezinme" veya "Özel Pencere". Safari dışındaki tüm tarayıcılar, web sayfasının gizli modda olup olmadığını bildirir. Safari her zaman hayır der. Gizli mod genellikle gizlilik için kullanılır. EasyEyes, ses kalibrasyonu için gereken EasyEyes Firebase kütüphanesine erişimi kolaylaştırmak için bunu kullanır."',
