    pl: 'Do połączenia danych między sesjami potrzebne jest unikalne ID. Ten komputer wcześniej brał udział w sesji na **ddd** z EasyEyes ID „**sss**”. Naciśnij OK, jeśli to Ty. W przeciwnym razie, jeśli masz plik EasyEyes ID, naciśnij przycisk wyboru pliku poniżej, aby go otworzyć. (Nazwa pliku zaczyna się od "EasyEyes", kończy się na ".txt" i zazwyczaj znajduje się w folderze Pobrane.) Jeśli nie masz pliku, ale znasz swoje EasyEyes ID, wpisz je. W przeciwnym razie po prostu wymyśl swoje własne ID, które może być dowolnym ciągiem alfanumerycznym o długości co najmniej 5 znaków. Może to być Twoje imię, jeśli chcesz. Zapamiętamy je dla Ciebie na tym komputerze, ale jeśli przejdziesz na inny komputer, proszę zabierz swój plik EasyEyes ID (najnowszy plik w folderze Pobrane) lub przynajmniej zapisz swoje EasyEyes ID. Używaj go za każdym razem, aby połączyć swoje dane z sesji na sesję."""',
    pt: "Loading...",
