    sr: "Loading...",
    es: '"Se necesita un ID único para vincular los datos entre sesiones. Esta computadora participó previamente en una sesión en **ddd** con el ID de EasyEyes "**sss**". Presiona OK si eres tú. De lo contrario, si tienes un archivo de ID de EasyEyes, presiona el botón de selección de archivo a continuación para abrirlo. (El nombre de archivo comienza con "EasyEyes", termina con ".txt" y generalmente se encuentra en tu carpeta de Descargas). Si no tienes un archivo, pero conoces tu ID de EasyEyes, escríbelo. De lo contrario, simplemente inventa tu propio ID, que puede ser cualquier cadena alfanumérica de al menos 5 caracteres. Puede ser tu nombre, si lo deseas. Lo recordaremos por ti en esta computadora, pero si vas a otra computadora, por favor lleva contigo tu archivo de ID de EasyEyes (el archivo más reciente en tu carpeta de Descargas), o al menos anota tu ID de EasyEyes. Úsalo cada vez para vincular tus datos de sesión en sesión."',
