    fa: "Loading...",
    pl: '"TWÓJ TELEFON Android. Potrzebujemy szczegółów dotyczących marki i modelu. Przejdź do Ustawienia > O telefonie (dawniej "O urządzeniu").\nDLA SAMSUNGA GALAXY: Skopiuj duży nagłówek "Galaxy ..." do pola Model Name poniżej, a skopiuj numer modelu do pola Model Number poniżej.\nDLA MOTO G: Nazwa modelu i (numer) są połączone w jedną linię o nazwie "Model". Skopiuj nazwę (poza nawiasami) do pola Model Name poniżej. Skopiuj numer w nawiasach, który może zawierać litery i cyfry, do pola Model Number poniżej.\nDLA INNEGO TELEFONU: Skopiuj "Nazwę produktu" do pola Model Name poniżej. Skopiuj "Nazwę modelu" do pola Model Number poniżej."',
    pt: "Loading...",
    ro: "Loading...",
    ru: '"ВАШ Android ТЕЛЕФОН. Нам нужны подробности, указывающие его марку и модель. Перейдите в Настройки > О телефоне (ранее "О устройстве").\nДЛЯ SAMSUNG GALAXY: Скопируйте большой заголовок "Galaxy ..." в поле "Название модели" ниже и скопируйте номер модели в поле "Номер модели" ниже.\nДЛЯ MOTO G: Название модели и (номер) объединены в одну строку, называемую "Модель". Скопируйте название (вне скобок) в поле "Название модели" ниже. Скопируйте номер в скобках, который может включать буквы и цифры, в поле "Номер модели" ниже.\nДЛЯ ЛЮБОГО ДРУГОГО ТЕЛЕФОНА: Скопируйте "Название продукта" в поле "Название модели" ниже. Скопируйте "Название модели" в поле "Номер модели" ниже."',
