    sv: '"DIN Android TELEFON. Vi behöver detaljer som specificerar dess märke och modell. Gå till Inställningar > Om telefonen (tidigare "Om enheten").\nFÖR SAMSUNG GALAXY: Kopiera den stora rubriken "Galaxy ..." till Modellnamn nedan, och kopiera Modellnummer till Modellnummer nedan.\nFÖR MOTO G: Modellnamnet och (nummer) kombineras till en rad som kallas "Modell". Kopiera namnet (utanför parenteserna) till Modellnamn nedan. Kopiera numret inom parenteserna, som kan innehålla bokstäver och siffror, till Modellnummer nedan.\nFÖR VILKEN ANNAN TELEFON SOM HELST: Kopiera "Produktnamn" till Modellnamn nedan. Kopiera "Modellnamn" till Modellnummer nedan."',
    tl: '"IYONG Android PHONE. Kailangan namin ng mga detalye na nagtatakda ng tatak at modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa aparato"). \nPARA SA SAMSUNG GALAXY: I-kopya ang malaking pamagat na "Galaxy ..." sa ibaba ng Pangalan ng Modelo, at i-kopya ang Numero ng Modelo sa ibaba ng Numero ng Modelo. \nPARA SA MOTO G: Ang pangalan ng modelo at (numero) ay pinagsama sa isang linya na tinatawag na "Modelo". I-kopya ang pangalan (labas ng mga panaklong) sa ibaba ng Pangalan ng Modelo. I-kopya ang numero sa mga panaklong, na maaaring maglaman ng mga titik at mga digit, sa ibaba ng Numero ng Modelo.\nPARA SA ANUMANG IBA PANG TELEPONO: I-kopya ang "Pangalan ng Produkto" sa ibaba ng Pangalan ng Modelo. I-kopya ang "Pangalan ng Modelo" sa ibaba ng Numero ng Modelo."',
    tr: "Loading...",
    ur: 'آپ کا اینڈروئڈ فون. ہمیں اس کی برانڈ اور ماڈل کی تفصیلات کی ضرورت ہے. ترتیبات پر جائیں> فون کے بارے میں (پہلے سے "ڈیوائس کے بارے میں"). \nسامسنگ گیلیکسی کے لئے: بڑے سرخی "گیلیکسی ..." کو نیچے ماڈل نام میں کاپی کریں اور ماڈل نمبر کو نیچے ماڈل نمبر میں کاپی کریں. \nموٹو جی کے لئے: ماڈل نام اور (نمبر) کو "ماڈل" کے نام کے ایک لائن میں ملا کر رکھا گیا ہے. نام (پیرانتھیز کے باہر) کو نیچے ماڈل نام میں کاپی کریں. پیرانتھیز میں شامل ہو سکتے ہیں حروف اور ہندسوں والے نمبر کو نیچے ماڈل نمبر میں کاپی کریں.\nکسی بھی دوسرے فون کے لئے: "پروڈکٹ نام" کو نیچے ماڈل نام میں کاپی کریں. "ماڈل نام" کو نیچے ماڈل نمبر میں کاپی کریں.',
