    cs: '"VÁŠ telefon Xiaomi. Potřebujeme podrobnosti specifikující jeho model. Přejděte do Nastavení > O telefonu (dříve "O zařízení"). Zkopírujte název modelu (např. "Xiaomi Mi 10", "Redmi Note 10", "Poco X3" nebo "Black Shark 4") a číslo modelu do příslušných polí níže. Na starších telefonech stiskněte Stav, abyste viděli tyto informace."',
