    fa: '"آیپد شما. ما به جزئیات مدل آن نیاز داریم. به تنظیمات بروید> عمومی> درباره. نام مدل را در زیر وارد کنید. سپس روی "شماره مدل" کلیک کنید تا شماره "A" پنهان شده را نشان دهد: یک "A" دنبال شده از چهار رقم. آن را در زیر وارد کنید."',
    pl: "Loading...",
    pt: '"SEU iPad. Precisamos de detalhes especificando o modelo. Vá para Configurações > Geral > Sobre. Copie o "Nome do Modelo" para o campo abaixo. Em seguida, toque no "Número do Modelo" para revelar o número "A" oculto: um "A" seguido de quatro dígitos. Digite isso no campo abaixo."',
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
