    pt: "SEU COMPUTADOR Linux. Precisamos de detalhes especificando sua marca e modelo. O modelo é encontrado de diferentes maneiras em diferentes sistemas Linux. Uma delas é olhar para o arquivo\n/sys/devices/virtual/dmi/id/product_name\nCopie o Nome e Número do Modelo para os campos correspondentes abaixo.",
    ro: "Loading...",
    ru: "ВАШ КОМПЬЮТЕР Linux. Нам нужны подробности, указывающие его марку и модель. Модель можно найти разными способами в разных системах Linux. Один из способов - посмотреть файл\n/sys/devices/virtual/dmi/id/product_name\nСкопируйте название и номер модели в соответствующие поля ниже.",
    sr: "Loading...",
    es: "Loading...",
    su: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: "YUNG iyong Linux COMPUTER. Kailangan namin ng mga detalye na nagtatakda ng tatak at modelo nito. Ang modelo ay natagpuan sa iba't ibang paraan sa iba't ibang mga sistema ng Linux. Isa ay tingnan ang file\n/sys/devices/virtual/dmi/id/product_name\nKopyahin ang Pangalan ng Modelo at Numero sa mga naaangkop na patlang sa ibaba.",
