    hy: "«Այս ուսուցումը պետք է օգտագործի վեբկամերային տեսախցիկը։ Վեբկամերային տեսախցիկին մատչելի դարձնելու համար հնարավոր է տրամադրել մուտքագրում, բայց այն առանց դրանից շարունակելու հնարավոր չէ։ Եթե դուք սխալով ասեցիք «Ոչ», իսկ հիմա ցանկանում եք տալ մեզ մուտքագրումը ձեր տեսախցիկին, խնդրում ենք գտնել տեսախցիկի պատկերանիշը հասցեվորման վրա, սեղմել այնը, թույլատրել տեսախցիկի մուտքագրումը և թարմացնել էջը։»",
    bg: "Loading...",
    "zh-CN": "我们找不到您的摄像头。",
    "zh-HK": "我们找不到您的摄像头。",
    hr: "Loading...",
    cs: "Loading...",
    da: "Denne undersøgelse kræver brug af webkameraet. Det er valgfrit at give adgang til dit webkamera, men vi kan ikke fortsætte uden det. Hvis du ved en fejl sagde Nej og nu ønsker at give os adgang til dit kamera, skal du finde kameraikonet i adresselinjen, klikke på det, tillade kameraadgang og opdatere siden.",
    nl: "Voor dit onderzoek is het nodig om de webcam te gebruiken. Het verlenen van toegang tot uw webcam is optioneel, maar we kunnen niet doorgaan zonder. Als u per ongeluk Nee heeft gezegd en nu toch toegang wilt geven tot uw camera, zoek dan het camerapictogram in de adresbalk, klik erop, sta cameratoegang toe en vernieuw de pagina.",
    "en-UK": "Loading...",
