    hi: "इस अध्ययन के लिए वेबकैम का उपयोग करना आवश्यक है। आपके वेबकैम का पहुंच देना वैकल्पिक है, लेकिन हम इसके बिना आगे नहीं बढ़ सकते। यदि आपने गलती से नहीं कहा है और अब हमें अपने कैमरे का पहुंच देना चाहते हैं, तो कृपया पता पट्टी में कैमरा आइकन ढूंढें, उसे क्लिक करें, कैमरा पहुंच को अनुमति दें और पेज को ताजगी दें।",
    hu: "Loading...",
