    it: "Questo studio ha bisogno di utilizzare la webcam. Concedere l'accesso alla tua webcam è facoltativo, ma non possiamo continuare senza di essa. Se hai detto di no per errore e ora desideri darci accesso alla tua fotocamera, trova l'icona della fotocamera nella barra degli indirizzi, cliccala, permetti l'accesso alla fotocamera e aggiorna la pagina.",
    ja: "「この研究ではウェブカメラを使用する必要があります。ウェブカメラへのアクセスを許可することは任意ですが、それなしでは続行できません。もし間違って「いいえ」と答えてしまい、今後カメラへのアクセスを許可したい場合は、アドレスバーにあるカメラのアイコンを見つけ、クリックしてカメラへのアクセスを許可し、ページを更新してください。」",
