    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: '"ALTRIMENTI, se l\'app della fotocamera del tuo telefono è troppo vecchia per leggere i codici QR, puoi installare un\'app apposita. Oppure puoi saltare questa parte premendo il pulsante "NON POSSO". Se non vuoi utilizzare il codice QR, per favore accedi al sondaggio premendo il pulsante "PREFERISCO NON FARLO". Infine, se non hai uno smartphone a portata di mano, premi "NESSUNO SMARTPHONE"."',
    ja: "Loading...",
    kn: "Loading...",
    ko: '그렇지 않으면, 핸드폰 카메라 앱이 QR 코드를 읽을 수 없을 경우, 해당 기능을 가진 앱을 설치할 수 있습니다. 또는 "CAN’T" 버튼을 눌러 건너뛸 수 있습니다. QR 코드를 사용하지 않으려면 "PREFER NOT" 버튼을 눌러 설문에 참여할 수 있습니다. 마지막으로, 스마트폰이 없는 경우 "NO SMARTPHONE" 버튼을 눌러주세요.',
    lt: "Loading...",
    ms: '"SELAIN ITU, jika aplikasi kamera telefon anda terlalu lama untuk membaca kod QR, anda boleh memasang aplikasi untuk itu. Atau anda boleh mengabaikannya dengan menekan butang "TIDAK BOLEH". Jika anda tidak mahu menggunakan kod QR, sila masukkan tinjauan dengan menekan butang "LEBIH SUKA TIDAK". Akhirnya, jika tiada telefon pintar yang mudah dijangkau, tekan "TIADA TELEFON PINTAR"."',
    ml: "Loading...",
    no: '"ELLERS, hvis kameraappen på telefonen din er for gammel til å lese QR-koder, kan du installere en app for det. Eller hoppe over det ved å trykke på "KAN IKKE" -knappen. Hvis du ikke ønsker å bruke QR-koden, kan du gå inn i undersøkelsen ved å trykke på "FORETREKKER IKKE" -knappen. Til slutt, hvis du ikke har en smarttelefon tilgjengelig, trykk på "INGEN SMARTTELEFON" -knappen."',
    fa: 'در غیر این صورت، اگر برنامه دوربین تلفن شما برای خواندن کدهای QR خیلی قدیمی است، می توانید یک برنامه برای آن نصب کنید. یا با فشار دادن دکمه "نمی توانم" آن را رد کنید. اگر نمی خواهید از کد QR استفاده کنید، لطفا با فشار دادن دکمه "ترجیح نمی دهم" وارد نظرسنجی شوید. در نهایت، اگر هیچ تلفن همراهی در دسترس نیست، دکمه "بدون تلفن همراه" را فشار دهید.',
