    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'DE LO CONTRARIO, si la aplicación de la cámara de tu teléfono es demasiado antigua para leer códigos QR, puedes instalar una aplicación para eso. O puedes omitirlo presionando el botón "NO PUEDO". Si no deseas utilizar el código QR, ingresa a la encuesta presionando el botón "PREFIERO NO". Finalmente, si no tienes un teléfono inteligente a mano, presiona "SIN TELÉFONO INTELIGENTE"."',
    su: 'LAIN HALNYA, lamun aplikasi kamera handphone anjeun terlalu kunaon pikeun maca kode QR, anjeun bisa ngahaja nginstal aplikasi pikeun eta. Atawa leumpangkeun ku ngaklik tombol "TEU BISA". Lamun anjeun teu hoyong ngagunakeun kode QR, mangga masihan surat ku ngaklik tombol "LEBIH PREFER". Pikeun nuhun, lamun teu aya handphone pintar, ngaklik tombol "TEU AYA HANDPHONE PINTAR".',
    sw: "Loading...",
