    ja: "📱 QRリンクをカメラで指します。 以下のQRコードを携帯電話のカメラで指し、携帯電話の画面でリンクをタップします。\n[稀ですが、このコンピューターが接続を失った場合は、この画面を更新してやり直すことができます。 アドレスバーをクリックしてRETURNを押してください。]",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "📱 PEK KAMERA PÅ QR-LINK. Pek telefonens kamera på QR-koden nedenfor, og trykk på lenken på telefonens skjerm. \n[Det er sjeldent, men hvis denne datamaskinen mister tilkoblingen, kan du starte på nytt ved å oppdatere denne skjermen. Klikk på adressefeltet og trykk PÅ.]",
    fa: "📱 دوربین را به لینک QR بگیرید. دوربین گوشی خود را به کد QR زیر بگیرید و روی لینک در صفحه گوشی خود ضربه بزنید.\n[این اتفاق بسیار کمی رخ می دهد، اما اگر این کامپیوتر اتصال را از دست بدهد، می توانید با تازه کردن این صفحه، دوباره شروع کنید. روی نوار آدرس کلیک کنید و RETURN را فشار دهید.]",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "📱 НАПРАВЬТЕ КАМЕРУ НА QR-ССЫЛКУ. Наведите камеру своего телефона на QR-код ниже и нажмите на ссылку на экране вашего телефона.\n[Это случается редко, но если соединение с этим компьютером пропадет, вы можете начать заново, обновив этот экран. Нажмите на строку адреса и нажмите RETURN.]",
