    ur: "📱 QR لنک پر کیمرہ رکھیں۔ اپنے فون کی کیمرے کو نیچے دیئے گئے QR کوڈ پر رکھیں اور اپنے فون کی اسکرین میں لنک پر ٹیپ کریں۔ \n[یہ کمزوری ہوتی ہے، لیکن اگر یہ کمپیوٹر رابطہ کھو دیتا ہے تو آپ اس اسکرین کو تازہ کرکے دوبارہ شروع کرسکتے ہیں۔ ایڈریس بار پر کلک کریں اور RETURN دبائیں۔]",
