    is: "Loading...",
    id: "Loading...",
    it: "ASSICURAZIONE DELLA PRIVACY DELLA TELECAMERA. Nessuna foto o video vengono registrati. Ogni fotogramma della webcam viene utilizzato solo all'interno di questo computer, esclusivamente per stimare la posizione degli occhi e dello sguardo, e poi cancellato entro 10 secondi. Vengono conservate solo le posizioni degli occhi e dello sguardo.",
