    it: "Misureremo le dimensioni di questo schermo. Utilizza il menu a tendina per scegliere qualcosa di utile. Puoi utilizzare qualsiasi connettore USB comune (compreso quello che fornisce alimentazione al tuo computer) o una carta di credito (o qualsiasi carta della stessa dimensione). Posiziona il tuo oggetto sullo schermo e sposta lo slider per regolare l'immagine in modo da farla corrispondere alle dimensioni del tuo oggetto. Quando corrispondono, premi INVIO (o clicca su OK) per procedere.",
