    id: "Loading...",
    it: "VOLUME MASSIMO. NIENTE CUFFIE. Per una calibrazione precisa del suono, massimizza il volume del computer ora, prima della calibrazione, e poi non toccare il volume fino alla fine dell'esperimento.\nUTILIZZA LA TELECAMERA PER OTTENERE IL LINK QR. Quando compare il codice QR di seguito, puntare la telecamera dello smartphone su di esso e fare clic sul link che compare sullo schermo dello smartphone. Seguire quindi le istruzioni sullo schermo dello smartphone.\n——————————————————————————————————————————\nSILENZIO PER FAVORE! REGISTRAZIONE IN CORSO. NON TOCCARE IL CONTROLLO DEL VOLUME.\n——————————————————————————————————————————\nPROBLEMA?\n1. La pagina web principale che esegue EasyEyes sul tuo laptop utilizza il protocollo webRTC per comunicare con la pagina web collegata al QR sul tuo smartphone. Questo protocollo cerca il modo migliore per connettersi tra diversi modi. Il migliore è quando il telefono e il computer sono entrambi sulla stessa rete WiFi.\n2. Se lo smartphone segnala un errore nella connessione, prova a chiudere e riavviare il browser dello smartphone, o addirittura a riavviare lo smartphone.\n3. È raro, ma se il suono non si sente, o dopo che si sente, non compare il pulsante Procedi, significa che la calibrazione è fallita. Puoi provare di nuovo aggiornando questa pagina del browser. Di solito questo risolve il problema.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: 'MAKSIMALUS GARSO LYGIS. Nenaudokite ausinių. Norint gauti tikslų garso kalibravimą, dabar, prieš kalibravimą, padidinkite savo kompiuterio garso lygį iki maksimumo ir tada nelieskite garso kol eksperimentas baigsis.\nNAUDOKITE KAMERĄ, KAD GAUTUMĖTE QR NUORODĄ. Kai žemiau atsiras QR kodas, nukreipkite savo išmanųjį telefono kamerą į jį ir spustelėkite nuorodą, kuri atsiras jūsų išmaniuoju telefono ekrane. Tada sekitės instrukcijas išmaniuoju telefono ekrane.\n——————————————————————————————————————————\nPRAŠOME TYLOS! DABAR VYKDOMAS ĮRAŠAS. NESIDOTINKITE GARSO VALDYMO.\n——————————————————————————————————————————\nPROBLEMA?\n1. Pagrindinė EasyEyes veikianti tinklalapio versija jūsų nešiojamajame kompiuteryje naudoja webRTC protokolą, kad bendrautų su QR nuorodą turinčiu tinklalapiu jūsų išmaniuoju telefone. Šis protokolas ieško geriausio būdo prisijungti. Geriausias būdas yra, kai jūsų telefonas ir kompiuteris yra tame pačiame WiFi tinkle.\n2. Jei jūsų išmanusis telefonas praneša apie ryšio klaidą, bandykite išjungti ir paleisti išmaniojo telefono naršyklę ar netgi iš naujo paleisti išmanųjį telefoną.\n3. Tai retai pasitaiko, bet jei garsas negrotų arba po jo grojimo nepasirodytų mygtukas "Tęsti", tai reiškia, kad kalibravimas nepavyko. Galite bandyti dar kartą atnaujindami šį naršyklės puslapį. Tai paprastai padeda.\n"""',
