    hi: "लाइन शिफ्ट बड़े और आसान से छोटे और कठिन तक भिन्न होता है। आप दो-तिहाई से ज्यादा सही नहीं कर सकते, इसलिए धीरे-धीरे करें। इसे एक अनुमान लगाने का खेल समझें और जितना हो सके उत्तर दें। जब आप सही होंगे, तो आपको एक बीप सुनाई देगी।",
