    ml: "Loading...",
    no: "PÅ LANG AVSTAND VIL DU BRUKE TELEFONEN DIN SOM ET TASTATUR. Koble den til nå for bruk senere. Pek smarttelefonkameraet ditt mot denne QR-koden. Bruk deretter fingeren din til å klikke på lenken som vises på smarttelefonskjermen din.",
