    kn: "Loading...",
    ko: "Loading...",
    lt: "Kiekvieno bandymo metu, kol žiūrite į taikinį, pora linijų bus ŠVIESIAI kur nors. Galbūt ten, kur žiūrite; galbūt šono akyje. Tiesiog šviesa. Norint išmokti užduotį, pirmiausia išbandykime ją su STATINE ekrano vaizdu. Žiūrint į taikinį žemiau, nesistumdami akimis: ar viršutinė linija pasislinko į kairę ar į dešinę, lyginant su apatine linija?",
