    is: "Á hverri reynslu munt þú heyra setningu og þú munt vera beðinn um að muna tvo orð. Hljóðið er skert og getur verið erfitt að þekkja það, því þú getur ekki fengið þau öll rétt. Ekki áhyggjast. Bara túlka það sem leik og gera þitt besta. Gangi þér vel. Ýttu á SKILA eða smelltu á FRAMHALDA til að halda áfram.\n\nFRAMHALDA hnappurinn hverfur strax og tilraunin byrjar þegar hljóðin eru hlaðin, sem tekur 40 sekúndur eða lengur, eftir hraða nettengingarinnar. Við erum að vinna í því að skammvíða þessa biðtíma í komandi útgáfu.\n\nHleð hljóðum ...",
    id: "Loading...",
    it: "In ogni prova sentirai una frase e poi ti verrà chiesto di ricordare due parole. Il suono è distorto e potrebbe essere difficile da riconoscere, quindi non puoi ottenere tutto giusto. Non preoccuparti. Trattalo come un gioco e fai del tuo meglio. Buona fortuna. Premi INVIO o clicca PROSEGUI per continuare.\n\nIl pulsante PROSEGUI scomparirà immediatamente e l'esperimento inizierà una volta che i suoni saranno caricati, il che richiede 40 secondi o più, a seconda della velocità della connessione internet. Stiamo lavorando per accorciare questo ritardo in una futura versione.\n\nCaricamento suoni...",
    ja: "「各試行では、文を聞いてから2つの単語を覚えるように求められます。音声は歪んでおり、認識が難しい場合があるため、すべて正しく覚えることはできません。心配しないでください。ただゲームとして取り組んで、最善を尽くしてください。幸運を祈ります。続行するにはRETURNキーを押すか、PROCEEDをクリックしてください。\n\nPROCEEDボタンはすぐに消え、音声が読み込まれると実験が開始されます。これにはインターネット接続の速度に応じて40秒以上かかる場合があります。将来のリリースでこの遅延を短縮するために取り組んでいます。\n\n音声を読み込んでいます...」",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Pada setiap percobaan, Anda akan mendengar sebuah kalimat, dan kemudian Anda akan diminta untuk mengingat dua kata. Suara tersebut terdistorsi dan mungkin sulit dikenali, sehingga Anda tidak dapat mengingat semuanya dengan benar. Jangan khawatir. Anggap saja ini sebagai permainan dan lakukan yang terbaik. Semoga berhasil. Tekan RETURN atau klik PROCEED untuk melanjutkan.\n\nTombol PROCEED akan segera menghilang, dan eksperimen akan dimulai setelah suara-suara dimuat, yang membutuhkan waktu 40 detik atau lebih, tergantung pada kecepatan koneksi internet. Kami sedang bekerja untuk memperpendek penundaan ini dalam rilis mendatang.\n\nMemuat suara...",
    ml: "Loading...",
    no: "På hvert forsøk vil du høre en setning, og så blir du bedt om å huske to av ordene. Lyden er forvrengt og kan være vanskelig å gjenkjenne, så du kan ikke få dem alle riktig. Ikke bekymre deg. Bare se på det som et spill og gjør ditt beste. Lykke til. Trykk på RETUR eller klikk FORTSETT for å fortsette.\n\nFORTSETT-knappen vil forsvinne umiddelbart, og eksperimentet vil begynne når lydene er lastet, noe som tar 40 sekunder eller lenger, avhengig av internettforbindelsens hastighet. Vi jobber med å forkorte denne forsinkelsen i en fremtidig utgivelse.\n\nLaster lyder ...",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "La fiecare încercare veți auzi o propoziție și apoi vi se va cere să vă amintiți două dintre cuvinte. Sunetul este distorsionat și poate fi greu de recunoscut, deci nu puteți să le ghiciți pe toate corect. Nu vă faceți griji. Tratați totul ca pe un joc și faceți tot ce puteți. Mult noroc. Apăsați RETURN sau faceți clic pe PROCEED pentru a continua.\n\nButonul PROCEED va dispărea imediat, iar experimentul va începe odată ce sunetele sunt încărcate, ceea ce durează 40 de secunde sau mai mult, în funcție de viteza conexiunii la internet. Lucrăm pentru a scurta această întârziere într-o versiune viitoare.\n\nSe încarcă sunetele...",
    ru: "Loading...",
    sr: "Loading...",
    es: "Loading...",
    su: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: "Sa bawat pagsubok, maririnig mo ang isang pangungusap, at pagkatapos ay itatanong sa iyo na tandaan ang dalawang salita. Ang tunog ay deformed at maaaring mahirap makilala, kaya hindi mo maaaring makuha ang lahat ng tama. Huwag mag-alala. Itrato ito bilang isang laro at gawin ang iyong makakaya. Good luck. Pindutin ang RETURN o i-click ang PROCEED para magpatuloy.\n\nAng button na PROCEED ay mawawala kaagad, at magsisimula ang eksperimento kapag ang mga tunog ay nai-load, na kumukuha ng 40 segundo o mas mahaba, depende sa bilis ng koneksyon sa internet. Kami ay nagtatrabaho upang maikli ang pagkaantala na ito sa isang susunod na paglabas.\n\nNaglo-load ng tunog...",
