    kn: "Loading...",
    ko: "Loading...",
    lt: '"GARSO APTIKIMAS. Jūs ketinate pradėti daugybės bandymų bloką. Jūs bandysite aptikti tam tikrą tikslinį garsą: vieną natą, kartojamą 8 kartus, visada tą pačią natą. Šis tikslas yra tik pusėje bandymų, atsitiktinai. Kiekviename bandyme jūsų užduotis yra klausytis ir nuspręsti, ar jis buvo, taip ar ne. Progresuojant nuo bandymo iki bandymo, remiantis jūsų atsakymais, tikslinio garso garsis prisitaikys taip, kad jis būtų vos pastebimas. Pradiniame praktikos bloke tikslas bus vienas. Vėlesniuose blokuose tikslas bus sunkiau aptikti dėl kitų garsų. Visada ignoruokite kitus garsus ir stenkitės pranešti, ar tikslinis garsas buvo. Naudokite "y" klavišą, jei taip, ir "n" klavišą, jei ne.\n\nPaspauskite RETURN arba spustelėkite TĘSTI, kai būsite pasiruošę. TĘSTI mygtukas išnyks nedelsiant, o eksperimentas prasidės, kai bus įkelti garsai, kas užtrunka 40 sekundžių ar ilgiau, priklausomai nuo interneto ryšio greičio. Mes siekiame sutrumpinti šį delsimo laiką ateities versijoje.\n\nGaunami garsai..."',
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: '"DETECTAREA SUNETULUI. Ești pe cale să începi un bloc de multe încercări. Încerci să detectezi un sunet țintă particular: o notă, repetată de 8 ori, mereu aceeași notă. Această țintă este prezentă doar în jumătate din încercări, aleatoriu. În fiecare încercare, sarcina ta este să asculți și să decizi dacă a fost prezentă, da sau nu. Pe măsură ce avansezi de la o încercare la alta, în funcție de răspunsurile tale, volumul sunetului țintă se va adapta astfel încât să fie abia detectabil. În blocul de practică inițial, ținta va fi singură. În blocurile ulterioare, ținta va fi mai greu de detectat din cauza altor sunete. Ignoră întotdeauna celelalte sunete și încearcă să raportezi, da sau nu, dacă sunetul țintă a fost prezent. Utilizează tasta "y" pentru da și tasta "n" pentru nu.\n\nApasă RETURN sau clic pe PROCEED imediat ce ești pregătit. Butonul PROCEED va dispărea imediat, iar experimentul va începe odată ce sunetele sunt încărcate, ceea ce durează 40 de secunde sau mai mult, în funcție de viteza conexiunii la internet. Lucrăm pentru a scurta această întârziere într-o versiune viitoare.\n\nSe încarcă sunetele..."',
    ru: "Loading...",
    sr: "Loading...",
    es: "Loading...",
    su: "Loading...",
    sw: "Loading...",
    sv: '"LJUDUPPTÄCKT. Du ska snart börja med en serie av många försök. Du försöker upptäcka en specifik målljud: en ton, upprepad 8 gånger, alltid samma ton. Den målet finns bara med på hälften av försöken, slumpmässigt. På varje försök är ditt jobb att lyssna och avgöra om den var närvarande, ja eller nej. I takt med att du fortsätter från försök till försök kommer målljudets volym att anpassas så att det knappt är upptäckbart. I den inledande övningsomgången kommer målet vara ensamt. I senare omgångar kommer målet vara svårare att upptäcka på grund av andra ljud. Ignorera alltid de andra ljuden och försök rapportera, ja eller nej, om målljudet var närvarande. Använd tangenten "y" för ja och tangenten "n" för nej.\n\nTryck på RETUR eller klicka på FORTSÄTT så snart du är redo. Knappen FORTSÄTT kommer att försvinna omedelbart och experimentet kommer att börja när ljuden har laddats, vilket tar 40 sekunder eller längre, beroende på internetanslutningens hastighet. Vi arbetar för att förkorta denna fördröjning i en framtida version.\n\nLaddar ljud..."',
    tl: 'DETEKSI NG TUNOG. Ikaw ay mag-uumpisa ng isang block ng maraming pagsubok. Sinusubukan mong madetect ang isang partikular na tunog: isang nota, paulit-ulit na 8 beses, palaging parehong nota. Ang target na ito ay naroroon lamang sa kalahati ng mga pagsubok, nang random. Sa bawat pagsubok, ang iyong trabaho ay makinig at magpasya kung ito ay naroroon, oo o hindi. Habang nagpapatuloy ka mula sa pagsubok hanggang sa pagsubok, batay sa iyong mga sagot, ang volume ng target sound ay mag-aadjust upang halos hindi na madetect. Sa unang practice block, ang target ay mag-isa. Sa mga sumunod na block, ang target ay magiging mas mahirap madetect dahil sa iba pang tunog. Palaging i-ignore ang iba pang tunog, at subukan na i-report, oo o hindi, kung ang target sound ay naroroon. Gamitin ang "y" key para sa oo at ang "n" key para sa hindi.\n\nPindutin ang RETURN o i-click ang PROCEED kapag handa ka na. Ang button ng PROCEED ay mawawala kaagad, at magsisimula ang eksperimento kapag ang mga tunog ay nalo-load, na tumatagal ng 40 segundo o higit pa, depende sa bilis ng internet connection. Kami ay nagtatrabaho upang maikli ang delay na ito sa susunod na release. \n\nNaglo-load ng mga tunog ...',
    tr: '"SES TESPİTİ. Birçok denemenin olduğu bir bloğa başlamak üzeresiniz. Belirli bir hedef sesi tespit etmeye çalışıyorsunuz: tek bir nota, 8 kez tekrarlanan, her zaman aynı nota. Bu hedef sadece denemelerin yarısında rastgele olarak bulunur. Her denemede, göreviniz var olanı dinlemek ve var mı yok mu karar vermektir. Denemeden denemeye ilerledikçe, yanıtlarınıza dayanarak hedef sesin ses düzeyi, neredeyse algılanamayacak şekilde ayarlanacaktır. İlk pratik blokta, hedef yalnız olacaktır. Sonraki bloklarda, diğer sesler nedeniyle hedefi tespit etmek daha zor olacaktır. Her zaman diğer sesleri görmezden gelin ve hedef sesin var olup olmadığını, evet veya hayır olarak bildirmeye çalışın. Evet için "y" tuşunu, hayır için "n" tuşunu kullanın.\n\nHazır olduğunuzda GERİ DÖN tuşuna basın veya İLERİ düğmesine tıklayın. İLERİ düğmesi hemen kaybolacak ve deney, sesler yüklendikten sonra başlayacaktır, bu da internet bağlantısının hızına bağlı olarak 40 saniye veya daha uzun sürebilir. Bu gecikmeyi gelecekteki bir sürümde kısaltmak için çalışıyoruz.\n\nSesler yükleniyor..."',
    ur: '"آواز کی پہچان. آپ بہت سارے آزمائشوں کا بلاک شروع کرنے والے ہیں۔ آپ کو ایک خاص ٹارگٹ آواز کا پتہ لگانے کی کوشش کر رہے ہیں: ایک نوٹ، 8 بار تکرار ہوتا ہے، ہمیشہ وہی نوٹ۔ یہ ٹارگٹ صرف آدھی آزمائشوں میں موجود ہوتا ہے، بے قاعدگی سے۔ ہر آزمائش میں، آپ کا کام یہ ہے کہ آپ سنیں اور فیصلہ کریں کہ کیا یہ موجود تھا، ہاں یا نہیں۔ آپ کے جوابات کے مطابق، آپ کی آواز کی حجم کو ایسا ترتیب دیا جائے گا کہ یہ مشکل سے قابل پتہ چلے۔ ابتدائی مشقی بلاک میں، ٹارگٹ تنہا ہوگا۔ بعد میں بلاکوں میں، دیگر آوازوں کی وجہ سے ٹارگٹ کو پتہ لگانا مشکل ہوگا۔ ہمیشہ دوسری آوازوں کو نظرانداز کریں، اور کوشش کریں کہ رپورٹ کریں، ہاں یا نہیں، کہ کیا ٹارگٹ آواز موجود تھی۔ ہاں کے لئے "y" کلید استعمال کریں اور نہ کے لئے "n" کلید استعمال کریں.\n\nتیار ہونے کے بعد RETURN دبائیں یا PROCEED پر کلک کریں۔ PROCEED بٹن فوراً غائب ہوجائے گا، اور تجربہ شروع ہوجائے گا جب آوازیں لوڈ ہوجائیں، جو انٹرنیٹ کنکشن کی رفتار پر منحصر ہوتی ہے۔ ہم اس تاخیر کو کم کرنے کیلئے کام کر رہے ہیں، ایک مستقبل کے اصدار میں۔\n\nآوازیں لوڈ ہو رہی ہیں..."',
